import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Funds.css';

const Funds = () => {
  const [results, setResults] = useState([]);

  useEffect(() => {
    const fetchResults = async () => {
      try {
        const API_URL = 'https://api.sec-api.io/?token=6b3bf19df1784cb1a59bf55a7834ca93a3e59ec3cdc6d629837d96b711f99a5e'; // Replace with your actual API token
        const requestBody = {
          query: 'formType:"NPORT-P"',
          from: '0',
          size: '200',
          sort: [{ filedAt: { order: 'desc' } }]
        };

        const response = await axios.post(API_URL, requestBody, {
          headers: {
            'Content-Type': 'application/json'
          }
        });

        const data = response.data.filings;
        const filingDetails = await Promise.all(
          data.map(async (item) => {
            try {
              const filingResponse = await axios.get(item.linkToFilingDetails);
              console.log("Data", data);

              const parser = new DOMParser();
              const xmlDoc = parser.parseFromString(filingResponse.data, "text/xml");
              console.log("XML Doc", xmlDoc);

              const returnInfo = xmlDoc.querySelector('ItemB5ReturnInformation');

              if (returnInfo) {
                const monthlyReturns = [
                  parseFloat(returnInfo.querySelector('MonthlyTotalReturnsMonth1')?.textContent || 0),
                  parseFloat(returnInfo.querySelector('MonthlyTotalReturnsMonth2')?.textContent || 0),
                  parseFloat(returnInfo.querySelector('MonthlyTotalReturnsMonth3')?.textContent || 0)
                ];
                return {
                  name: xmlDoc.querySelector('FundName')?.textContent || 'N/A',
                  position: xmlDoc.querySelector('Position')?.textContent || 'N/A',
                  year: xmlDoc.querySelector('Year')?.textContent || 'N/A',
                  monthlyReturns,
                  classIdentificationNumber: returnInfo.querySelector('ClassIdentificationNumber')?.textContent || 'N/A'
                };
              }
              return null;
            } catch (error) {
              console.error('Error fetching filing details:', error);
              return null;
            }
          })
        );

        // try{}

        function displayXML(xmlDoc) {
          // Example: Display the entire XML as a string
          const xmlString = new XMLSerializer().serializeToString(xmlDoc);
          console.log("XML String", xmlString);


          // Insert this string into a preformatted <pre> tag for readability
          // document.getElementById("xmlContent").innerText = xmlString;

          // Example: Get the content of a specific node
          // const specificNode = xmlDoc.getElementsByTagName("YourElementTagName")[0];
          // if (specificNode) {
          //     document.getElementById("specificContent").innerText = specificNode.textContent;
          // }
      }

        try {
          fetch('http://localhost:4000/xmldata')
          .then(response => response.text())
          .then(data => {
              // Parse and display the XML data
              const parser = new DOMParser();
              const xmlDoc = parser.parseFromString(data, "text/xml");
              console.log("XML Data", xmlDoc);

              displayXML(xmlDoc);
          })
    .catch(error => console.error('Error fetching XML:', error));
        } catch (error) {
          console.error('There was an error fetching the data!', error);
        }
    // .catch(error => console.error('Error fetching XML:', error));
    //     const filteredResults = filingDetails.filter(item => item !== null);
    //     setResults(filteredResults);
      } catch (error) {
        console.error('There was an error fetching the data!', error);
        setResults([]); // Clear results on error
      }
   };

    fetchResults();
  }, []);

  const calculateMER = (monthlyReturns) => {
    const averageReturn = monthlyReturns.reduce((acc, val) => acc + val, 0) / monthlyReturns.length;
    return (averageReturn * 12).toFixed(2);
  };

  return (
    <div className="search-container1">
      <h2>Funds Return Information</h2>
      <div className="search-results1">
        {results.map((result, index) => (
          <div key={index} className="search-result1">
            <p><strong>Name:</strong> {result.name}</p>
            <p><strong>Position:</strong> {result.position}</p>
            <p><strong>Year:</strong> {result.year}</p>
            <p><strong>Class Identification Number:</strong> {result.classIdentificationNumber}</p>

            <h3>Monthly Total Return Record</h3>
            {result.monthlyReturns && (
              <div>
                {result.monthlyReturns.map((returnData, idx) => (
                  <p key={idx}>{`Month ${idx + 1}: ${returnData}`}</p>
                ))}
                <p><strong>MER (Annual):</strong> {calculateMER(result.monthlyReturns)}%</p>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Funds;
